global.set("gameState", "stopped");
global.set("gameDuration", 3600000 / 4);
global.set("elapsedTimeDelta", 0);
global.set("timeRemaining", 3600000);
global.set("wheelState", "UNSOLVED");
global.set("fuelState", "UNSOLVED");
global.set("starState", "UNSOLVED");
return msg;

if (global.get("fuelState") != "SOLVED") {
    if (msg.payload == "fuel_hint") {
        msg.fuelState = "HINT_GIVEN";
        global.set("fuelState", "HINT_GIVEN");
    } else if (msg.payload == "fuel_solved") {
        msg.fuelState = "SOLVED";
        global.set("fuelState", "SOLVED");
    }
}

if (msg.payload == "global_reset") {
    msg.fuelState = "UNSOLVED";
    global.set("fuelState", "UNSOLVED");
}

return msg;

if (global.get("wheelState") != "SOLVED") {
    if (msg.payload == "wheels_hint") {
        msg.wheelState = "HINT_GIVEN";
        global.set("wheelState", "HINT_GIVEN");
    } else if (msg.payload == "wheels_solved") {
        msg.wheelState = "SOLVED";
        global.set("wheelState", "SOLVED");
    }
}

if (msg.payload == "global_reset") {
    msg.wheelState = "UNSOLVED";
    global.set("wheelState", "UNSOLVED");
}

return msg;

if (global.get("starState") != "SOLVED") {
    if (msg.payload == "star_hint") {
        msg.starState = "HINT_GIVEN";
        global.set("starState", "HINT_GIVEN");
    } else if (msg.payload == "star_solved") {
        msg.starState = "SOLVED";
        global.set("starState", "SOLVED");
    }
}

if (msg.payload == "global_reset") {
    msg.starState = "UNSOLVED";
    global.set("starState", "UNSOLVED");
}

return msg;
